const PizzaBlock = ({ pizza }) => {
  return (
    <div className="pizza">
      <div className="pizza__img">
        <img className="food-image" src={pizza.src} alt="" />
      </div>
      <div className="pizza__title">{pizza.name}</div>

      <div className="pizza__descriptions">Соус, моцарелла, орегано</div>

      <div className="pizza__price">
        33 см / 85 грн <br />
        <br />
        45 см / 160 грн
      </div>

      <div className="button">
        <div className="button-link">замовити</div>
      </div>
    </div>
  );
};

export default PizzaBlock;
